def inverse(length, init, rtable, seq):
    for i in xrange(length):
        val = (rtable[seq + i] % length)
        if i != val:
            '''
            init[i] = table[i] ^ table[val]
            init[val] = init[i] ^ table[val]
            init[i] = init[i] ^ init[val]
            '''
            init[i] = init[i] ^ init[val]
            init[val] = init[i] ^ init[val]
            init[i] = init[i] ^ init[val]

    return init

def bit_inverse(length, init):
    bit_set = 0
    for i in xrange(length):
        if init[i] == bit_set:
            bit_set ^= 1
            init[i] = 1
        else:
            init[i] = 0
    return init

